import './App.css';
import Signup from './Signup';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path='/' component={OtpPage} />
        </Switch>
      </Router>
      <Signup />
    </div>
  );
}

export default App;
